import React from "react";
import "./MovieDetails.css";


class  MovieDetails extends React.Component {
    constructor(props){
        super(props);
        this.state={
            movie:{},
        }
    }
    render() {
        return <div className="movie-page">Movie</div>
    }
}

export default MovieDetails;
